import "./App.css";
import { Users } from "./users";

function App() {
  return (
    <div className="app">
      <input type="text" placeholder="search..." className="search" />
      <ul className="list">
        {Users.map((user) => {
          <li className="listItem" key={user.id}>
            {user.first_name}
          </li>;
        })}
      </ul>
    </div>
  );
}

export default App;
